text:
Replying to @realDonaldTrump Trump suggested today that he deserves credit for the record low cancer death rate. 

The American Cancer Society, which did the report, tells CNN he doesn’t: the 2017 data reflects “advances that occurred in prior years.”

@JacqEHoward + @ddale8 Trump takes credit for decline in cancer deaths. The American Cancer Society says he's wrongPresident Donald Trump bragged on Twitter about his administration playing a role in the US cancer death rate going down. The American Cancer Society says he's wrong and cancer death reductions...cnn.com
